function solve(required, available) {
  if (Object.keys(available).length < Object.keys(required).length) return 0;
  const countMap = {};
  const portions = [];
  for (const item in required) {
    const temp = [];
    if (!available[item]) {
      return 0;
    }
    temp.push(required[item]);
    temp.push(available[item]);
    countMap[item] = temp;
  }
  for (const item in countMap) {
    const need = countMap[item][0];
    const have = countMap[item][1];
    if (have < need) return 0;
    const rem = have % need;
    const portion = (have - rem) / need;
    portions.push(portion);
  }
  return Math.min(...portions);
}

